import streamlit as st
st.set_page_config(page_title='My Streamlit', page_icon='random')
mymenu=st.sidebar.selectbox('My Menu',('Home','FillForm','Downloads'))
st.image('https://th.bing.com/th/id/OIP.PQQcs1a3tG23B3T9RMCb3gHaK5?w=206&h=303&c=7&r=0&o=5&pid=1.7')
st.title('Bharti Vohra')
st.header('Aarohi Jain')
st.text('This ia a Practice on Streamlit Library')
if(mymenu=='Home'):
    st.image('data:image/jpeg;base64,')
    st.markdown('<center><h1>WELCOME HERE</h1></center',unsafe_allow_html=True)
    st.video('https://youtu.be/mOEL8Q-2bSo')
elif(mymenu=='FillForm'):
    with st.form('My Form'):
        name=st.text_input('Enter Name')
        dob=st.date_input('Choose Date of Birth')
        salary=st.slider('Choose Salary')
        a=st.form_submit_button('Submit Form')
        if a:
            st.write('Name',name,'DOB:',dob,'Salary:',salary)
elif(mymenu=='Downloads'):
    st.header('Downloads')
    st.download_button('Download Now','Hello This is the download data','vohra.txt')
            
